import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import {Image, Col, Row, Navbar, Container, Nav, NavDropdown, Dropdown} from 'react-bootstrap';
import logotipo from '../../assets/logo-better-price.png';
import './styles.css' 

const Layout = (props) =>{
  return(
    <>
      <nav className="decorate-nav">
        <Navbar expand="lg">
        <Container> 
          <Navbar.Brand href="#home">
            <img src={logotipo} alt='Logotipo de Better Price' Style="width:5.4em; height: 60px"/>
          </Navbar.Brand> 
          <Dropdown>
            <Dropdown.Toggle variant="success" id="dropdown-basic">
                Dropdown Button
            </Dropdown.Toggle>
            <DropdownButton>
              <Dropdown.Item href='#'></Dropdown.Item>
              <Dropdown.Item href='#'></Dropdown.Item>
              <Dropdown.Item href='#'></Dropdown.Item>
            </DropdownButton>
          </Dropdown>
        </Container>
        </Navbar>
      </nav>
      <footer> 
        {props.children}
      </footer>
    </>
  );
}

export default Layout;
